import { useState, useEffect } from "react";

const allowedTypes = [
  "application/pdf",           // PDF
  "application/vnd.openxmlformats-officedocument.wordprocessingml.document", // DOCX
  "application/vnd.openxmlformats-officedocument.spreadsheetml.sheet", // XLSX
  "image/png",
  "image/jpeg",
  "image/jpg"
];

function ContainerEntryForm() {
  const [formData, setFormData] = useState({
    // other fields...
    // no 'docs' here now, using packingListFile below
  });

  // Store packing list file and preview info
  const [packingListFile, setPackingListFile] = useState(null);
  const [fileError, setFileError] = useState("");
  const [filePreviewUrl, setFilePreviewUrl] = useState(null);

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handlePackingListChange = (e) => {
    const file = e.target.files[0];
    if (!file) return;

    if (!allowedTypes.includes(file.type)) {
      setFileError("Unsupported file format. Please upload PDF, DOCX, XLSX, PNG, or JPG.");
      setPackingListFile(null);
      setFilePreviewUrl(null);
      return;
    }

    setFileError("");
    setPackingListFile(file);

    // Create preview for images and PDFs only
    if (file.type.startsWith("image/") || file.type === "application/pdf") {
      const url = URL.createObjectURL(file);
      setFilePreviewUrl(url);
    } else {
      setFilePreviewUrl(null);
    }
  };

  // Cleanup object URL when component unmounts or file changes
  useEffect(() => {
    return () => {
      if (filePreviewUrl) URL.revokeObjectURL(filePreviewUrl);
    };
  }, [filePreviewUrl]);

  const handleSubmit = (e) => {
    e.preventDefault();
    if (fileError) {
      alert("Please fix the errors before submitting.");
      return;
    }

    console.log("Form Data:", formData);
    console.log("Packing List File:", packingListFile);

    // Submit formData + packingListFile to backend
  };

  return (
    <div className="max-w-7xl mx-auto bg-white p-4 rounded shadow border border-gray-200">
      <form onSubmit={handleSubmit} className="grid grid-cols-1 md:grid-cols-3 gap-3 text-sm">
        <h2 className="col-span-full text-lg font-semibold mb-2">Container Entry</h2>

        {/* Other inputs like consignee, poNo, etc... */}
        {/* For brevity, omitted here, but add them as before */}

        {/* Packing List Upload */}
        <div className="col-span-full">
          <label htmlFor="packingList" className="block mb-1 font-semibold">
            Upload Packing List
          </label>
          <input
            id="packingList"
            type="file"
            accept=".pdf, .docx, .xlsx, image/png, image/jpeg"
            onChange={handlePackingListChange}
            className="border rounded px-2 py-1 w-full"
          />
          {fileError && <p className="text-red-600 mt-1">{fileError}</p>}

          {/* Preview */}
          {filePreviewUrl && packingListFile && packingListFile.type === "application/pdf" && (
            <div className="mt-2 border rounded overflow-hidden" style={{ height: 400 }}>
              <embed
                src={filePreviewUrl}
                type="application/pdf"
                width="100%"
                height="100%"
              />
            </div>
          )}

          {filePreviewUrl && packingListFile && packingListFile.type.startsWith("image/") && (
            <img
              src={filePreviewUrl}
              alt="Packing List Preview"
              className="mt-2 max-h-64 object-contain border rounded"
            />
          )}

          {/* For DOCX/XLSX just show file name with download link */}
          {!filePreviewUrl && packingListFile && !packingListFile.type.startsWith("image/") && packingListFile.type !== "application/pdf" && (
            <p className="mt-2">
              File ready:{" "}
              <a
                href={URL.createObjectURL(packingListFile)}
                download={packingListFile.name}
                className="text-blue-600 underline"
                onClick={(e) => {
                  // Prevent memory leak, revoke after click
                  setTimeout(() => URL.revokeObjectURL(e.target.href), 1000);
                }}
              >
                {packingListFile.name}
              </a>
            </p>
          )}
        </div>

        {/* Personal note */}
        <div className="col-span-full">
          <label htmlFor="note" className="block mb-1">Personal Note</label>
          <textarea
            id="note"
            name="note"
            value={formData.note || ""}
            onChange={handleChange}
            className="w-full border rounded px-2 py-1"
            rows="2"
          />
        </div>

        <div className="col-span-full">
          <button
            type="submit"
            className="w-full bg-blue-600 text-white py-1.5 rounded hover:bg-blue-700"
          >
            Submit
          </button>
        </div>
      </form>
    </div>
  );
}

export default ContainerEntryForm;
